script: |
  super -f text -I q7543.spq | sort > q7543.out

inputs:
  - name: q7543.spq
    data: |
      SELECT col2 AS col1 FROM tab2 (FORMAT parquet) WHERE col1 NOT BETWEEN ( col0 + col1 / col0 ) AND - col2 + col0;
  - name: tab2

outputs:
  - name: q7543.out
    data: |
      26
      27
      38
